import json
import re

# Load week10.json
with open('/Users/albaraa/Downloads/PSYC 100 Section 1_20260112_2050/study-site/src/data/weeks/week10.json', 'r') as f:
    data = json.load(f)

def count_words(text):
    return len(text.split())

issues = []
total_questions = 0
correct_word_counts = []
incorrect_word_counts = []

for topic in data['topics']:
    if 'questions' not in topic:
        continue

    for idx, q in enumerate(topic['questions'], 1):
        total_questions += 1

        # Check if explanation exists
        if 'explanation' not in q:
            issues.append(f"Q{total_questions}: Missing 'explanation' field")
            continue

        exp = q['explanation']

        # Check correct explanation
        if 'correct' not in exp:
            issues.append(f"Q{total_questions}: Missing 'correct' field")
        else:
            wc = count_words(exp['correct'])
            correct_word_counts.append(wc)
            if wc < 25:
                issues.append(f"Q{total_questions}: Correct explanation too short ({wc} words, need 30-60)")
            elif wc > 80:
                issues.append(f"Q{total_questions}: Correct explanation too long ({wc} words, max 70)")

            # Check for citation
            if not any(word[0].isupper() and len(word) > 3 for word in exp['correct'].split()):
                issues.append(f"Q{total_questions}: Correct explanation lacks proper noun/citation")

        # Check incorrect explanations
        if 'incorrect' not in exp:
            issues.append(f"Q{total_questions}: Missing 'incorrect' field")
        else:
            incorrect = exp['incorrect']
            expected_options = [opt for opt in q['options'] if opt != q['answer']]

            if len(incorrect) != len(expected_options):
                issues.append(f"Q{total_questions}: Has {len(incorrect)} incorrect explanations, expected {len(expected_options)}")

            for wrong_opt, wrong_exp in incorrect.items():
                wc = count_words(wrong_exp)
                incorrect_word_counts.append(wc)
                if wc < 15:
                    issues.append(f"Q{total_questions}: Incorrect '{wrong_opt[:30]}...' too short ({wc} words, need 20-40)")
                elif wc > 55:
                    issues.append(f"Q{total_questions}: Incorrect '{wrong_opt[:30]}...' too long ({wc} words, max 50)")

print(f"=== Week 10 Quality Check ===")
print(f"Total questions: {total_questions}")
print(f"Correct explanation word count: avg={sum(correct_word_counts)/len(correct_word_counts):.1f}, min={min(correct_word_counts)}, max={max(correct_word_counts)}")
print(f"Incorrect explanation word count: avg={sum(incorrect_word_counts)/len(incorrect_word_counts):.1f}, min={min(incorrect_word_counts)}, max={max(incorrect_word_counts)}")
print(f"\nIssues found: {len(issues)}")
if issues:
    for issue in issues[:20]:  # Show first 20 issues
        print(f"  - {issue}")
    if len(issues) > 20:
        print(f"  ... and {len(issues)-20} more issues")
else:
    print("  ✓ All checks passed!")
